import React from "react";

const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <h2>hover over images</h2>
            {/* rename html elment to a functional react componet */}
            <ImageToggleOnMouseOver primaryImg="/static/bw/img1-bw.jpg"
            secondaryImg="/static/img1-bw.jpg" alt="" />
            &nbsp;&nbsp;&nbsp;
            <ImageToggleOnMouseOver primaryImg="/static/bw/img2-bw.jpg"
            primaryImg="/static/bw/img2-bw.jpg" alt="" />
        </div>
    );
};

export default ImageChangeOnMouseOver;
